    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16510538183590037','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16510538183590037", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:37.904Z", "lastUser" : "r.azami", "Datamart.coll" : "Оборудование сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX owl: <http://www.w3.org/2002/07/owl#>\nPREFIX rule: <http://ontology.adms.ru/UIP/rule/1#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n\nSELECT DISTINCT ?unique_key ?mRID ?IRIОборудования ?ИдентификаторСК11 ?НаименованиеЭлементаСтруктурыСети ?НаименованиеКлассаНапряжения ?ДлинаПроводника ?ТипСистемыШин \n ?ТипОборудования ?IRIКонтейнера\nWHERE {\n ?TopologicalNode a astu:TopologicalNode ;\n astu:TopologicalNode.ConnectivityNodeContainer ?EquipmentContainer .\n ?TopologicalNode astu:TopologicalNode.Terminal ?Terminal .\n ?Terminal a astu:Terminal ;\n astu:Terminal.ConductingEquipment ?IRIОборудования .\n ?IRIОборудования a ?ConductingEquipmentClass .\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.mRID ?mRID}\n filter (?ConductingEquipmentClass != owl:NamedIndividual)\n OPTIONAL {?IRIОборудования astu:Equipment.EquipmentContainer ?IRIКонтейнера}\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети}\n OPTIONAL { \n ?IRIОборудования astu:ConductingEquipment.BaseVoltage ?EquipmentBaseVoltage .\n OPTIONAL {\n ?EquipmentBaseVoltage astu:IdentifiedObject.name ?EquipmentBaseVoltageName .\n }\n }\n OPTIONAL {?IRIОборудования astu:Conductor.length ?ДлинаПроводника }\n OPTIONAL {?IRIОборудования astu:BusbarSection.busbarSystemKind ?ТипСистемыШин }\n OPTIONAL {\n ?IRIОборудования astu:PowerTransformer.PowerTransformerEnd ?PowerTransformerEnd .\n ?PowerTransformerEnd astu:TransformerEnd.BaseVoltage ?TEBaseVoltage .\n ?TEBaseVoltage astu:IdentifiedObject.name ?TEBaseVoltageName .\n }\n BIND(IF(BOUND(?EquipmentBaseVoltage),?EquipmentBaseVoltage,?TEBaseVoltage) AS ?BaseVoltage)\n BIND(IF(BOUND(?EquipmentBaseVoltage),?EquipmentBaseVoltageName,IF(BOUND(?TEBaseVoltageName),?TEBaseVoltageName,\"\")) AS ?НаименованиеКлассаНапряжения)\n BIND(CONCAT(STR(?IRIОборудования),IF(BOUND(?BaseVoltage), STR(?BaseVoltage), \"\")) AS ?unique_key)\n BIND(IF(BOUND(?mRID),?mRID,\"\") AS ?ИдентификаторСК11)\n BIND(replace(str(?ConductingEquipmentClass),str(astu:),\"\") as ?ConductingEquipmentType)\n BIND(IF(BOUND(?ConductingEquipmentType),IF(?ConductingEquipmentType = \"PowerTransformer\",\"Силовой трансформатор\",\n IF(?ConductingEquipmentType = \"ACLineSegment\",\"Сегмент линии\",\n IF(?ConductingEquipmentType = \"BusbarSection\",\"Секция шин\",\"\"))),\"\") as ?ТипОборудования)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16509717633630031", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16517368117440038", "label" : "Запись в витрину оборудования", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.657775Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16510658028340009','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16510658028340009", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:38.219Z", "lastUser" : "r.azami", "Datamart.coll" : "Передача информации о ЛС", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\n SELECT DISTINCT ?unique_key ?НомерЛС ?НаименованиеКонтрагента ?НаименованиеКонтрагентаПолное ?ТипКонтрагента \n ?ИмяКонтрагента ?ФамилияКонтрагента ?ИннКонтрагента ?КодКонтрагента ?КодЛС ?КодЗаявки ?КодДоговораЭС ?ДоговорIRI ?ЗаявкаIRI ?КонтрагентIRI ?КППКонтрагента ?ТелефонКонтрагента\n ?EMailКонтрагента ?ПочтовыйАдресКонтрагента ?ЮрАдресКонтрагента ?РЭС ?УчастокЛС ?НомерДоговораЭС ?ДатаДоговораЭС ?ДатаПодготовкиДоговораЭС\n WHERE { \n\t\t\t?ДоговорIRI a astu:CustomerAgreement .\n \t\t\t?ДоговорIRI astu:CustomerAgreement.TechConnectActs ?ЗаявкаIRI .\n OPTIONAL { \n ?CustomerAgreement astu:IdentifiedObject.Name ?CustomerAgreementNameObj .\n ?CustomerAgreementNameObj astu:Name.name ?КодДоговораЭС .\n BIND(astu:CustomerAgreement_code as ?CustomerAgreementNameObjNameType)\n ?CustomerAgreementNameObj astu:Name.NameType ?CustomerAgreementNameObjNameType .\n ?CustomerAgreementNameObjNameType astu:NameType.name ?CustomerAgreementNameObjNameTypeName .\n }\n OPTIONAL { ?CustomerAgreement astu:Document.code ?НомерДоговораЭС }\n OPTIONAL { ?CustomerAgreement astu:Document.createdDateTime ?ДатаДоговораЭС }\n OPTIONAL { ?CustomerAgreement astu:Document.lastModifiedDateTime ?ДатаПодготовкиДоговораЭС }\n OPTIONAL { ?ДоговорIRI astu:Document.code ?НомерЛС }\n OPTIONAL { \n ?ДоговорIRI astu:IdentifiedObject.Name ?CustomerAgreementNameObj .\n ?CustomerAgreementNameObj astu:Name.name ?КодЛС .\n BIND(astu:CustomerAgreement_code as ?CustomerAgreementNameObjNameType)\n ?CustomerAgreementNameObj astu:Name.NameType ?CustomerAgreementNameObjNameType .\n ?CustomerAgreementNameObjNameType astu:NameType.name ?CustomerAgreementNameObjNameTypeName .\n }\n OPTIONAL { \n ?ЗаявкаIRI astu:IdentifiedObject.Name ?TechConnectApplicationNameObj .\n ?TechConnectApplicationNameObj astu:Name.name ?КодЗаявки .\n BIND(astu:TechConnectApplication_code as ?TechConnectApplicationNameObjNameType)\n ?TechConnectApplicationNameObj astu:Name.NameType ?TechConnectApplicationNameObjNameType .\n ?TechConnectApplicationNameObjNameType astu:NameType.name ?TechConnectApplicationNameObjNameTypeName .\n }\n OPTIONAL { \n ?ДоговорIRI astu:CustomerAgreement.Customer ?КонтрагентIRI .\n OPTIONAL { ?КонтрагентIRI astu:IdentifiedObject.name ?НаименованиеКонтрагента . }\n OPTIONAL { ?КонтрагентIRI astu:IdentifiedObject.aliasName ?НаименованиеКонтрагентаПолное . }\n OPTIONAL { ?КонтрагентIRI astu:Customer.customerType ?ТипКонтрагента . }\n OPTIONAL { ?КонтрагентIRI astu:Customer.firstName ?ИмяКонтрагента . }\n OPTIONAL { ?КонтрагентIRI astu:Customer.surName ?ФамилияКонтрагента . }\n OPTIONAL { ?КонтрагентIRI astu:Customer.individTaxNumber ?ИннКонтрагента . }\n OPTIONAL {\n ?КонтрагентIRI astu:IdentifiedObject.Name ?CustomerNameObj .\n ?CustomerNameObj astu:Name.name ?КодКонтрагента .\n ?CustomerNameObj astu:Name.NameType ?CustomerNameObjNameType .\n ?CustomerNameObjNameType astu:NameType.name ?CustomerNameObjNameTypeName .\n }\n OPTIONAL { ?КонтрагентIRI astu:Customer.Kpp ?КППКонтрагента }\n OPTIONAL { ?КонтрагентIRI astu:Customer.ContactNumber ?ТелефонКонтрагента }\n OPTIONAL { ?КонтрагентIRI astu:Customer.EMail ?EMailКонтрагента }\n OPTIONAL { ?КонтрагентIRI astu:Customer.PostalAddress ?ПочтовыйАдресКонтрагента }\n OPTIONAL { ?КонтрагентIRI astu:Customer.LegalAddress ?ЮрАдресКонтрагента }\n }\n BIND(STR(?ДоговорIRI) AS ?unique_key)\n }", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16510604077960005", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Transform_16510657998440008", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.660322Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16511508585510005','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16511508585510005", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:38.377Z", "lastUser" : "r.azami", "Datamart.coll" : "Заключение договора ТП", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\n SELECT DISTINCT ?unique_key ?НомерДоговораТП ?ДатаДоговораТП ?КодДоговораТП ?КодЗаявки ?ЗаявкаIRI\n WHERE {\n ?ЗаявкаIRI a astu:TechConnectAct .\n OPTIONAL { \n ?ЗаявкаIRI astu:IdentifiedObject.Names ?КодДоговораТПIRI . \n ?КодДоговораТПIRI astu:Name.name ?КодДоговораТП .\n ?КодДоговораТПIRI astu:Name.NameType ?TechConnectActNameObjNameType .\n ?TechConnectActNameObjNameType astu:NameType.name \"код договора ТП\" .\n }\n OPTIONAL { ?ЗаявкаIRI astu:TechConnectAct.AgreementTCNumber ?НомерДоговораТП }\n OPTIONAL { ?ЗаявкаIRI astu:TechConnectAct.AgreementTCDate ?ДатаДоговораТП }\n OPTIONAL { \n ?ЗаявкаIRI astu:IdentifiedObject.Names ?TechConnectApplicationNameObj .\n ?TechConnectApplicationNameObj astu:Name.name ?КодЗаявки .\n BIND(astu:TechConnectApplication_code as ?TechConnectApplicationNameObjNameType)\n ?TechConnectApplicationNameObj astu:Name.NameType ?TechConnectApplicationNameObjNameType .\n ?TechConnectApplicationNameObjNameType astu:NameType.name ?TechConnectApplicationNameObjNameTypeName .\n }\n BIND(STR(?ЗаявкаIRI) AS ?unique_key)\n }", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16511485282640003", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Message_16511508621130006", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/