    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16516491654250011','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16516491654250011", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:38.630Z", "lastUser" : "r.azami", "Datamart.coll" : "Готовность к присоединению", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nSELECT DISTINCT ?unique_key ?МестоПрисоединения ?НаименованиеЭлементаСети ?ТипЭлементаСети ?КодЭлементаСети ?НомерУведомленияВТУ \n?ДатаУведомленияВТУ ?ТочкаПрисоединенияIRI ?ЗаявкаIRI ?ДатаТУ ?НомерТУ ?КодТочкиПрисоединения\nWHERE {\n ?ЗаявкаIRI astu:TechConnectAct.TechConnectionSchemes ?ТочкаПрисоединенияIRI .\n ?ТочкаПрисоединенияIRI a astu:TechConnectionSheme . \n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.Name ?СхемаПрисоединения . } \n\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.techConnectPointCode ?КодТочкиПрисоединения . } \n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.fulfillNoticeNumber ?НомерУведомленияВТУ . } \n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.fulfillNoticeDate ?ДатаУведомленияВТУ . } \n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.techConditionNumber ?НомерТУ . } \n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.techConditionDate ?ДатаТУ . } \n OPTIONAL { \n ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.SchemeLine ?Line .\n OPTIONAL { ?Line astu:IdentifiedObject.name ?LineName . } \n OPTIONAL { ?Line astu:IdentifiedObject.aliasName ?LineAliasName . } \n } \n OPTIONAL { \n ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.SchemePS ?Substation .\n OPTIONAL { ?Substation astu:IdentifiedObject.name ?SubstationName . } \n OPTIONAL { ?Substation astu:IdentifiedObject.aliasName ?SubstationAliasName . } \n }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.NetworkElementType ?ТипЭлементаСети . } \n BIND(IF(BOUND(?SubstationName),?SubstationName, ?LineName) as ?НаименованиеЭлементаСети)\n BIND(IF(BOUND(?SubstationAliasName),?SubstationAliasName, ?LineAliasName) as ?КодЭлементаСети)\n BIND(STR(?ТочкаПрисоединенияIRI) AS ?unique_key)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16512381906340013", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Load_16600483869350004", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.665489Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16516694692820018','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16516694692820018", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:38.787Z", "lastUser" : "r.azami", "Datamart.coll" : "Передача точки поставки", "Datamart.query" : " PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\n SELECT DISTINCT ?unique_key ?НаименованиеТочкиПоставки ?КодТочкиПоставки ?ТочкаПрисоединенияIRI ?ТочкаПоставкиIRI ?УчастокТП ?РЭС\n WHERE {\n\t\t\t?ТочкаПоставкиIRI a astu:UsagePoint . \n\t\t\t?ТочкаПоставкиIRI astu:UsagePoint.UsagePointTechConnectionShemes ?ТочкаПрисоединенияIRI .\n ?ТочкаПрисоединенияIRI a astu:TechConnectionSheme . \n OPTIONAL {\n ?ТочкаПоставкиIRI astu:IdentifiedObject.Name ?MeterNameObj . \n ?MeterNameObj astu:Name.name ?КодТочкиПоставки .\n ?MeterNameObj astu:Name.NameType ?MeterNameObjNameType .\n ?MeterNameObjNameType astu:NameType.name ?MeterNameObjNameTypeName .\n }\n OPTIONAL { ?ТочкаПоставкиIRI astu:IdentifiedObject.name ?НаименованиеТочкиПоставки }\n OPTIONAL {\n ?ТочкаПоставкиIRI astu:UsagePoint.SubGeographicalRegion ?SubGeographicalRegion .\n OPTIONAL {?SubGeographicalRegion astu:IdentifiedObject.name ?УчастокТП}\n OPTIONAL {\n ?SubGeographicalRegion astu:SubGeographicalRegion.Region ?Region .\n OPTIONAL {?Region astu:IdentifiedObject.name ?РЭС}\n }\n }\n BIND(STR(?ТочкаПоставкиIRI) AS ?unique_key)\n }", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16516687858420011", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Transform_16516694671630017", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/r