    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16517368117440038','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16517368117440038", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:38.054Z", "lastUser" : "v.kozlov", "Datamart.coll" : "Контейнеры оборудования сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX owl: <http://www.w3.org/2002/07/owl#>\nPREFIX rule: <http://ontology.adms.ru/UIP/rule/1#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n\nSELECT DISTINCT ?unique_key ?mRID ?IRIКонтейнера ?ИдентификаторСК11 ?НаименованиеЭлементаСтруктурыСети ?НаименованиеКлассаНапряжения ?ПризнакЦентраПитания \n ?IRIПодстанции ?ТипКонтейнера\nWHERE {\n ?TopologicalNode a astu:TopologicalNode ;\n astu:TopologicalNode.ConnectivityNodeContainer ?IRIКонтейнера .\n ?IRIКонтейнера a ?EquipmentContainerClass .\n filter(?EquipmentContainerClass != owl:NamedIndividual)\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.mRID ?mRID}\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети}\n OPTIONAL {\n ?IRIКонтейнера astu:VoltageLevel.BaseVoltage ?BaseVoltage .\n ?BaseVoltage rule:select (rdfs:label ?НаименованиеКлассаНапряжения)\n }\n OPTIONAL {?IRIКонтейнера astu:Substation.isSupplyCenter ?ПризнакЦентраПитания}\n OPTIONAL {?IRIКонтейнера astu:VoltageLevel.Substation ?VoltageLevelSubstation}\n OPTIONAL {\n ?IRIКонтейнера astu:Bay.VoltageLevel ?VoltageLevel .\n ?VoltageLevel astu:VoltageLevel.Substation ?BaySubstation\n }\n BIND(IF(BOUND(?mRID),?mRID,\"\") AS ?ИдентификаторСК11)\n BIND(STR(?IRIКонтейнера) AS ?unique_key)\n BIND(replace(str(?EquipmentContainerClass),str(astu:),\"\") as ?EquipmentContainerType)\n BIND(IF(BOUND(?EquipmentContainerType),IF(?EquipmentContainerType = \"Substation\",\"Подстанция\",\n IF(?EquipmentContainerType = \"Line\",\"Линия\",\n IF(?EquipmentContainerType = \"VoltageLevel\",\"РУ\",\"\"))),\"\") as ?ТипКонтейнера)\n BIND(IF(BOUND(?VoltageLevelSubstation),?VoltageLevelSubstation,IF(BOUND(?BaySubstation),?BaySubstation,\"\"))as ?IRIПодстанции)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16509717633630031", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16517455833410039", "label" : "Запись в витрину контейнера", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.670569Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16517455833410039','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16517455833410039", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:38.936Z", "lastUser" : "r.azami", "Datamart.coll" : "Нормальная схема", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX owl: <http://www.w3.org/2002/07/owl#>\nPREFIX rule: <http://ontology.adms.ru/UIP/rule/1#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n\nSELECT DISTINCT ?unique_key ?IRI ?НаименованиеТопологическогоУзла ?НаименованиеКлассаНапряжения ?НаправлениеПитания ?НаименованиеОборудования ?ТипОборудования \n ?Статус ?IRIОборудования\nWHERE {\n ?IRI a astu:TopologicalNode ;\n astu:TopologicalNode.ConnectivityNodeContainer ?EquipmentContainer .\n ?IRI astu:TopologicalNode.Terminal ?Terminal .\n OPTIONAL {\n ?IRI astu:TopologicalNode.BaseVoltage ?BaseVoltage .\n ?BaseVoltage rule:select (rdfs:label ?НаименованиеКлассаНапряжения)\n }\n OPTIONAL {?IRI astu:IdentifiedObject.name ?НаименованиеТопологическогоУзла}\n ?Terminal a astu:Terminal ;\n astu:Terminal.ConductingEquipment ?IRIОборудования ;\n astu:Terminal.TieFlow ?TieFlow .\n ?TieFlow astu:TieFlow.positiveFlowIn ?PositiveFlowIn .\n ?IRIОборудования a ?ConductingEquipmentClass .\n filter (?ConductingEquipmentClass != owl:NamedIndividual)\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.name ?НаименованиеОборудования}\n BIND(concat(STR(?IRI),STR(?Terminal)) AS ?unique_key)\n BIND(IF(?PositiveFlowIn = false,\"Питаемое\",\"Питающее\") as ?НаправлениеПитания)\n BIND(replace(str(?ConductingEquipmentClass),str(astu:), \"\") as ?ConductingEquipmentClassName)\n BIND(IF(?ConductingEquipmentClassName = \"PowerTransformer\",\"Трансформатор\",IF(?ConductingEquipmentClassName = \"ACLineSegment\",\"Сегмент линии\",\n IF(?ConductingEquipmentClassName = \"BusbarSection\", \"Секция шин\", ?ConductingEquipmentClassName))) as ?ТипОборудования)\n BIND (\"Действующее\" as ?Статус)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16509717633630031", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Transform_16523366081340010", "label" : "Запись в витрину нормальной схемы", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.672912Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16527759914680009','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16527759914680009", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:39.090Z", "lastUser" : "r.azami", "Datamart.coll" : "Передача данных об активации договора ЭС", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nSELECT DISTINCT ?unique_key ?НомерДоговора ?ДатаАктивацииДоговора ?КодЗаявки ?КодДоговора ?ДоговорIRI ?ЗаявкаIRI\nWHERE {\n ?ДоговорIRI a astu:CustomerAgreement .\n OPTIONAL{\n ?ДоговорIRI astu:CustomerAgreement.TechConnectActs ?ЗаявкаIRI .\n OPTIONAL{\n ?ЗаявкаIRI astu:IdentifiedObject.Names ?TechConnectActNameObj .\n ?TechConnectActNameObj astu:Name.name ?КодЗаявки .\n BIND(astu:TechConnectApplication_code as ?TechConnectActNameObjNameType)\n ?TechConnectActNameObj astu:Name.NameType ?TechConnectActNameObjNameType .\n ?TechConnectActNameObjNameType astu:NameType.name ?TechConnectActNameObjNameTypeName .\n }\n }\n OPTIONAL{?ДоговорIRI astu:Document.Code ?НомерДоговора}\n OPTIONAL { \n ?ДоговорIRI astu:Agreement.ValidityInterval ?ДатаАктивацииДоговораIRI .\n ?ДатаАктивацииДоговораIRI astu:DateTimeInterval.start ?ДатаАктивацииДоговора .\n }\n \n OPTIONAL { \n ?ДоговорIRI astu:IdentifiedObject.Names ?CustomerAgreementNameObj .\n ?CustomerAgreementNameObj astu:Name.name ?КодДоговора .\n BIND(astu:CustomerAgreement_code as ?CustomerAgreementNameObjNameType)\n ?CustomerAgreementNameObj astu:Name.NameType ?CustomerAgreementNameObjNameType .\n ?CustomerAgreementNameObjNameType astu:NameType.name ?CustomerAgreementNameObjNameTypeName .\n }\n BIND(STR(?ДоговорIRI) AS ?unique_key)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16527757232080004", "Rule.next" : 