    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16530503080760024','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16530503080760024", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:40.232Z", "lastUser" : "r.azami", "Datamart.coll" : "Нормальная схема", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\n\nSELECT DISTINCT ?unique_key ?IRI ?НаименованиеТопологическогоУзла ?НаправлениеПитания ?НаименованиеОборудования ?ТипОборудования ?Статус\n\nWHERE {\n ?IRI a astu:TopologicalNode ;\n astu:TopologicalNode.Terminal ?Terminal ;\n astu:TopologicalNode.ConnectivityNodeContainer ?EquipmentContainer .\n OPTIONAL {\n ?EquipmentContainer astu:IdentifiedObject.name ?НаименованиеТопологическогоУзла .\n }\n ?Terminal a astu:Terminal ;\n astu:Terminal.ConductingEquipment ?ConductingEquipment .\n ?Terminal astu:Terminal.TieFlow ?TieFlow .\n ?TieFlow astu:TieFlow.positiveFlowIn ?PositiveFlowIn .\n ?ConductingEquipment a ?ConductingEquipmentClass ;\n astu:IdentifiedObject.name ?НаименованиеОборудования .\n\n BIND(concat(STR(?IRI),STR(?Terminal)) AS ?unique_key)\n BIND(IF(?PositiveFlowIn = false,\"Питаемое\",\"Питающее\") as ?НаправлениеПитания)\n BIND(replace(str(?ConductingEquipmentClass),str(astu:), \"\") as ?ConductingEquipmentClassName)\n BIND(IF(?ConductingEquipmentClassName = \"PowerTransformer\",\"Трансформатор\",IF(?ConductingEquipmentClassName = \"ACLineSegment\",\"Сегмент линии\",\n IF(?ConductingEquipmentClassName = \"BusbarSection\", \"Секция шин\", ?ConductingEquipmentClassName))) as ?ТипОборудования)\n BIND (\"Архивное\" as ?Статус)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16529697001360019", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Delete_16530555831430035", "