    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16533008237780079','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16533008237780079", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:40.385Z", "lastUser" : "r.azami", "Datamart.coll" : "Нормальная схема", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX owl: <http://www.w3.org/2002/07/owl#>\nPREFIX rule: <http://ontology.adms.ru/UIP/rule/1#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n\nSELECT DISTINCT ?unique_key ?IRI ?НаименованиеТопологическогоУзла ?НаименованиеКлассаНапряжения ?НаправлениеПитания ?НаименованиеОборудования ?ТипОборудования \n ?Статус ?IRIОборудования\nWHERE {\n ?IRI a astu:TopologicalNode .\n ?IRI astu:TopologicalNode.Terminal ?Terminal .\n OPTIONAL {\n ?IRI astu:TopologicalNode.BaseVoltage ?BaseVoltage .\n ?BaseVoltage rule:select (rdfs:label ?НаименованиеКлассаНапряжения)\n }\n OPTIONAL {?IRI astu:IdentifiedObject.name ?НаименованиеТопологическогоУзла}\n ?Terminal a astu:Terminal ;\n astu:Terminal.ConductingEquipment ?IRIОборудования ;\n astu:Terminal.TieFlow ?TieFlow .\n ?TieFlow astu:TieFlow.positiveFlowIn ?PositiveFlowIn .\n ?IRIОборудования a ?ConductingEquipmentClass .\n filter (?ConductingEquipmentClass != owl:NamedIndividual)\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.name ?НаименованиеОборудования}\n BIND(concat(STR(?IRI),STR(?Terminal)) AS ?unique_key)\n BIND(IF(?PositiveFlowIn = false,\"Питаемое\",\"Питающее\") as ?НаправлениеПитания)\n BIND(replace(str(?ConductingEquipmentClass),str(astu:), \"\") as ?ConductingEquipmentClassName)\n BIND(IF(?ConductingEquipmentClassName = \"PowerTransformer\",\"Трансформатор\",IF(?ConductingEquipmentClassName = \"ACLineSegment\",\"Сегмент линии\",\n IF(?ConductingEquipmentClassName = \"BusbarSection\", \"Секция шин\", ?ConductingEquipmentClassName))) as ?ТипОборудования)\n BIND (\"Действующее\" as ?Статус)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16532993300650059", "label" : "Запись в витрину", "@context" : { "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.695051Z','admin'),
