    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16533082598040008','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16533082598040008", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:40.784Z", "lastUser" : "r.azami", "Datamart.coll" : "Схема Питания", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX m: <http://www.iec.ch/TC57/2011/schema/message>\n\nSELECT DISTINCT ?unique_key ?IRIОстрова ?НаименованиеОстрова ?IRIКонтейнераОборудования ?НаименованиеКонтейнераОборудования ?ТипКонтейнераОборудования \n?НаправлениеПитания \nWHERE {\n ?IRIОстрова a astu:TopologicalIsland ;\n astu:TopologicalIsland.TopologicalNodes ?TopologicalNode ;\n astu:IdentifiedObject.name ?НаименованиеОстрова .\n ?TopologicalNode astu:TopologicalNode.ConnectivityNodeContainer ?IRIКонтейнераОборудования .\n ?IRIКонтейнераОборудования a ?IRIТипКонтейнераОборудования ;\n astu:IdentifiedObject.name ?НаименованиеКонтейнераОборудования .\n BIND(\"Питаемый\" as ?НаправлениеПитания)\n BIND(concat(STR(?IRIОстрова),STR(?TopologicalNode)) AS ?unique_key)\n BIND(replace(str(?IRIТипКонтейнераОборудования),str(astu:), \"\") as ?ТипКонтейнераОборудованияClassName)\n BIND(IF(?ТипКонтейнераОборудованияClassName = \"Substation\",\"Подстанция\",\"Линия\") as ?ТипКонтейнераОборудования)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16532997759400060", "label" : "Запись в витрину TopNodes", "@context" : { "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.699681Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16535815689090045','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16535815689090045", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:40.933Z", "lastUser" : "r.azami", "Datamart.coll" : "Оборудование сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX owl: <http://www.w3.org/2002/07/owl#>\nPREFIX rule: <http://ontology.adms.ru/UIP/rule/1#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n\nSELECT DISTINCT ?unique_key ?mRID ?IRIОборудования ?ИдентификаторСК11 ?НаименованиеЭлементаСтруктурыСети ?НаименованиеКлассаНапряжения ?ДлинаПроводника ?ТипСистемыШин \n ?ТипОборудования ?IRIКонтейнера\nWHERE {\n ?TopologicalNode a astu:TopologicalNode ;\n astu:TopologicalNode.ConnectivityNodeContainer ?EquipmentContainer .\n ?TopologicalNode astu:TopologicalNode.Terminal ?Terminal .\n ?Terminal a astu:Terminal ;\n astu:Terminal.ConductingEquipment ?IRIОборудования .\n ?IRIОборудования a ?ConductingEquipmentClass .\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.mRID ?mRID}\n filter (?ConductingEquipmentClass != owl:NamedIndividual)\n OPTIONAL {?IRIОборудования astu:Equipment.EquipmentContainer ?IRIКонтейнера}\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети}\n OPTIONAL { \n ?IRIОборудования astu:ConductingEquipment.BaseVoltage ?EquipmentBaseVoltage .\n ?EquipmentBaseVoltage rule:select (rdfs:label ?EquipmentBaseVoltageName)\n }\n OPTIONAL {?IRIОборудования astu:Conductor.length ?ДлинаПроводника }\n OPTIONAL {?IRIОборудования astu:BusbarSection.busbarSystemKind ?ТипСистемыШин }\n OPTIONAL {\n ?IRIОборудования astu:PowerTransformer.PowerTransformerEnd ?PowerTransformerEnd .\n ?PowerTransformerEnd astu:TransformerEnd.BaseVoltage ?TEBaseVoltage .\n ?TEBaseVoltage rule:select (rdfs:label ?TEBaseVoltageName)\n }\n BIND(IF(BOUND(?EquipmentBaseVoltage),?EquipmentBaseVoltage,?TEBaseVoltage) AS ?BaseVoltage)\n BIND(IF(BOUND(?EquipmentBaseVoltageName),?EquipmentBaseVoltageName,IF(BOUND(?TEBaseVoltageName),?TEBaseVoltageName,\"\")) AS ?НаименованиеКлассаНапряжения)\n BIND(CONCAT(STR(?IRIОборудования),IF(BOUND(?BaseVoltage), STR(?BaseVoltage), \"\")) AS ?unique_key)\n BIND(IF(BOUND(?mRID),?mRID,\"\") AS ?ИдентификаторСК11)\n BIND(replace(str(?ConductingEquipmentClass),str(astu:),\"\") as ?ConductingEquipmentType)\n BIND(IF(BOUND(?ConductingEquipmentType),IF(?ConductingEquipmentType = \"PowerTransformer\",\"Силовой трансформатор\",\n IF(?ConductingEquipmentType = \"ACLineSegment\",\"Сегмент линии\",\n IF(?ConductingEquipmentType = \"BusbarSection\",\"Секция шин\",\"\"))),\"\") as ?ТипОборудования)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16524551944280050", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16535816349300046", "label" : "Запись в витрину оборудования", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.702025Z','admin');
INSERT INTO "ServiceData" (iri, type, "profileVersion", configuration, content, "lastUpdated", "updatedBy") VALUES
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16535816349300046','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16535816349300046", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:41.093Z", "lastUser" : "r.azami", "Datamart.coll" : "Контейнеры оборудования сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX owl: <http://www.w3.org/2002/07/owl#>\nPREFIX rule: <http://ontology.adms.ru/UIP/rule/1#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n\nSELECT DISTINCT ?unique_key ?mRID ?IRIКонтейнера ?ИдентификаторСК11 ?НаименованиеЭлементаСтруктурыСети ?НаименованиеКлассаНапряжения ?ПризнакЦентраПитания \n ?IRIПодстанции ?ТипКонтейнера\nWHERE {\n ?TopologicalNode a astu:TopologicalNode ;\n astu:TopologicalNode.ConnectivityNodeContainer ?IRIКонтейнера .\n ?IRIКонтейнера a ?EquipmentContainerClass .\n filter(?EquipmentContainerClass != owl:NamedIndividual)\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.mRID ?mRID}\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети}\n OPTIONAL {\n ?IRIКонтейнера astu:VoltageLevel.BaseVoltage ?BaseVoltage .\n ?BaseVoltage rule:select (rdfs:label ?НаименованиеКлассаНапряжения)\n }\n OPTIONAL {?IRIКонтейнера astu:Substation.isSupplyCenter ?ПризнакЦентраПитания}\n OPTIONAL {?IRIКонтейнера astu:VoltageLevel.Substation ?VoltageLevelSubstation}\n OPTIONAL {\n ?IRIКонтейнера astu:Bay.VoltageLevel ?VoltageLevel .\n ?VoltageLevel astu:VoltageLevel.Substation ?BaySubstation\n }\n BIND(IF(BOUND(?mRID),?mRID,\"\") AS ?ИдентификаторСК11)\n BIND(STR(?IRIКонтейнера) AS ?unique_key)\n BIND(replace(str(?EquipmentContainerClass),str(astu:),\"\") as ?EquipmentContainerType)\n BIND(IF(BOUND(?EquipmentContainerType),IF(?EquipmentContainerType = \"Substation\",\"Подстанция\",\n IF(?EquipmentContainerType = \"Line\",\"Линия\",\n IF(?EquipmentContainerType = \"VoltageLevel\",\"РУ\",\"\"))),\"\") as ?ТипКонтейнера)\n BIND(IF(BOUND(?VoltageLevelSubstation),?VoltageLevelSubstation,IF(BOUND(?BaySubstation),?BaySubstation,\"\"))as ?IRIПодстанции)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16524551944280050", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16535816658590047", "label" : "Запись в витрину контейнера", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.705573Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16535816658590047','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16535816658590047", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:41.246Z", "lastUser" : "v.kozlov", "Datamart.coll" : "Нормальная схема", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX owl: <http://www.w3.org/2002/07/owl#>\nPREFIX rule: <http://ontology.adms.ru/UIP/rule/1#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n\nSELECT DISTINCT ?unique_key ?IRI ?НаименованиеТопологическогоУзла ?НаименованиеКлассаНапряжения ?НаправлениеПитания ?НаименованиеОборудования ?ТипОборудования \n ?Статус ?IRIОборудования\nWHERE {\n ?IRI a astu:TopologicalNode ;\n astu:TopologicalNode.ConnectivityNodeContainer ?EquipmentContainer .\n ?IRI astu:TopologicalNode.Terminal ?Terminal .\n OPTIONAL {\n ?IRI astu:TopologicalNode.BaseVoltage ?BaseVoltage .\n ?BaseVoltage rule:select (rdfs:label ?НаименованиеКлассаНапряжения)\n }\n OPTIONAL {?IRI astu:IdentifiedObject.name ?НаименованиеТопологическогоУзла}\n ?Terminal a astu:Terminal ;\n astu:Terminal.ConductingEquipment ?IRIОборудования ;\n astu:Terminal.TieFlow ?TieFlow .\n ?TieFlow astu:TieFlow.positiveFlowIn ?PositiveFlowIn .\n ?IRIОборудования a ?ConductingEquipmentClass .\n filter (?ConductingEquipmentClass != owl:NamedIndividual)\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.name ?НаименованиеОборудования}\n BIND(concat(STR(?IRI),STR(?Terminal)) AS ?unique_key)\n BIND(IF(?PositiveFlowIn = false,\"Питаемое\",\"Питающее\") as ?НаправлениеПитания)\n BIND(replace(str(?ConductingEquipmentClass),str(astu:), \"\") as ?ConductingEquipmentClassName)\n BIND(IF(?ConductingEquipmentClassName = \"PowerTransformer\",\"Трансформатор\",IF(?ConductingEquipmentClassName = \"ACLineSegment\",\"Сегмент линии\",\n IF(?ConductingEquipmentClassName = \"BusbarSection\", \"Секция шин\", ?ConductingEquipmentClassName))) as ?ТипОборудования)\n BIND (\"Действующее\" as ?Статус)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16524551944280050", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Load_16705849297140020", "label" : "Запись в витрину нормальной схемы", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.708048Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16535841649550054','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16535841649550054", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:41.421Z", "lastUser" : "v.kozlov", "Datamart.coll" : "Подписание акта ТП", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nSELECT DISTINCT ?unique_key ?ДатаПодписанияАкта ?АктТПIRI \nWHERE {\n ?АктТПIRI a astu:TechConnectAct ;\n astu:TechConnectAct.actTCDate ?ДатаПодписанияАкта .\n BIND(STR(?АктТПIRI) AS ?unique_key)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16523380270840011", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Load_16559003427560020", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.710536Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16536655710900185','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16536655710900185", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:41.565Z", "lastUser" : "v.kozlov", "Datamart.coll" : "Передача информации о подписании Акта ТП", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nSELECT DISTINCT ?unique_key ?НомерАктаТП ?КодАктаТП ?НомерТУ ?ДатаТУ ?МощностьСубабонентов1 ?МощностьСубабонентов2 ?МощностьСубабонентов3 ?АктТПIRI ?ТочкаПрисоединенияIRI \n?НаименованиеСубабонента ?ОбъектНаименованиеСубабонента ?АдресСубабонента ?МаксМощность1КатегорииСубабонента ?МаксМощность2КатегорииСубабонента \n?МаксМощность3КатегорииСубабонента ?ВСчётМощностиАбонента ?ВСчётМощностиСубабонента ?НомерТУСубабонента ?ДатаТУСубабонента ?НомерАктаОВыполненииТУСубабонента \n?ДатаАктаОВыполненииТУСубабонента ?СубабонентIRI ?ДатаПодписанияАктов ?НомерАктаТП ?ДатаПодписания ?ВидПодключения ?ОписаниеПрисоединения ?МаксМощностьВТочкеПрисоединения \n?МаксМощностьАбонента1 ?РанееПрисоединеннаяМаксМощностьАбонента1 ?МаксМощностьАбонента2 ?РанееПрисоединённаяМаксМощностьАбонента2 ?МаксМощностьАбонента3 \n?РанееПрисоединённаяМаксМощностьАбонента3 ?ПараметрыРасчётаВЛКЛотГБПдоТП ?ТипТрансформатора ?МощностьТрансформатора ?ПараметрыРасчётаВЛКЛотТПдоСчётчика \n?ОписаниеГраницБалансовойПринадлежности ?ОписаниеГраницЭксплутационнойОтветственностиСторон ?НаименованиеЭлектроустановкиСетевойОрганизации \n?НаименованиеЭлектроустановкиАбонент ?КодДоговора ?НомерДоговораТП ?ДатаИсполненияДоговораТП\nWHERE {\n ?АктТПIRI a astu:TechConnectAct .\n\n OPTIONAL { ?АктТПIRI astu:TechConnectAct.techConditionNumber ?НомерТУ . }\n OPTIONAL { ?АктТПIRI astu:TechConnectAct.executionContractDate ?ДатаИсполненияДоговораТП . }\n OPTIONAL { ?АктТПIRI astu:TechConnectAct.AgreementTCNumber ?НомерДоговораТП . }\n OPTIONAL { ?АктТПIRI astu:TechConnectAct.techConditionDate ?ДатаТУ . }\n OPTIONAL { ?АктТПIRI astu:TechConnectAct.powerSubabon1 ?МощностьСубабонентов1 . }\n OPTIONAL { ?АктТПIRI astu:TechConnectAct.powerSubabon2 ?МощностьСубабонентов2 . }\n OPTIONAL { ?АктТПIRI astu:TechConnectAct.powerSubabon3 ?МощностьСубабонентов3 . }\n OPTIONAL { \n ?АктТПIRI astu:TechConnectAct.subAbon ?СубабонентIRI . \n OPTIONAL { ?СубабонентIRI astu:IdentifiedObject.name ?НаименованиеСубабонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.subAbonObject ?ОбъектНаименованиеСубабонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.address ?АдресСубабонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.maxPower1category ?МаксМощность1КатегорииСубабонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.maxPower2category ?МаксМощность2КатегорииСубабонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.maxPower3category ?МаксМощность3КатегорииСубабонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.onAccountAbon ?ВСчётМощностиАбонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.onAccountSubAbon ?ВСчётМощностиСубабонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.techConditionNumber ?НомерТУСубабонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.techConditionDate ?ДатаТУСубабонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.fulfillActNumber ?НомерАктаОВыполненииТУСубабонента . }\n OPTIONAL { ?СубабонентIRI astu:TechConnectSubAbon.fulfillActDate ?ДатаАктаОВыполненииТУСубабонента . }\n }\n\n OPTIONAL {\n ?АктТПIRI astu:TechConnectAct.TechConnectionSchemes ?ТочкаПрисоединенияIRI .\n OPTIONAL {\n ?ТочкаПрисоединенияIRI astu:IdentifiedObject.Names ?Names .\n ?Names astu:Name.name ?КодАктаТП ;\n astu:Name.NameType ?NameType .\n ?NameType a astu:NameType ;\n astu:NameType.name \"код акта ТП\" .\n }\n OPTIONAL {\n ?АктТПIRI astu:IdentifiedObject.Names ?Names .\n ?Names astu:Name.name ?КодДоговора ;\n astu:Name.NameType ?NameType .\n ?NameType a astu:NameType ;\n astu:NameType.name \"код договора ТП\" .\n }\n OPTIONAL {\n ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.actTC ?actTCIRI .\n OPTIONAL { ?actTCIRI astu:ActTC.actTCDateSignBothPart ?ДатаПодписанияАктов . }\n OPTIONAL { ?actTCIRI astu:ActTC.actTCNumber ?НомерАктаТП . }\n OPTIONAL { ?actTCIRI astu:ActTC.actTCDate ?ДатаПодписания . }\n }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.connectionMethod ?ВидПодключения . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.ConnectPointDescr ?ОписаниеПрисоединения . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.maxPowerConnectPoint ?МаксМощностьВТочкеПрисоединения . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.newMaxPowerAbon1 ?МаксМощностьАбонента1 . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.prevMaxPowerAbon1 ?РанееПрисоединеннаяМаксМощностьАбонента1 . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.newMaxPowerAbon2 ?МаксМощностьАбонента2 . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.prevMaxPowerAbon2 ?РанееПрисоединённаяМаксМощностьАбонента2 . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.newMaxPowerAbon3 ?МаксМощностьАбонента3 . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.prevMaxPowerAbon3 ?РанееПрисоединённаяМаксМощностьАбонента3 . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.calcParamBeforeSdp ?ПараметрыРасчётаВЛКЛотГБПдоТП . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.transformerType ?ТипТрансформатора . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.transformerPower ?МощностьТрансформатора . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.calcParamAfterSdp ?ПараметрыРасчётаВЛКЛотТПдоСчётчика . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.delimPointBalanceRespons ?ОписаниеГраницБалансовойПринадлежности . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.DelimPointOperatRespons ?ОписаниеГраницЭксплутационнойОтветственностиСторон . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.DelimPointGridCompany ?НаименованиеЭлектроустановкиСетевойОрганизации . }\n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.DelimPointDescrAbon ?НаименованиеЭлектроустановкиАбонент . }\n }\n\n BIND(STR(?АктТПIRI) AS ?unique_key)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16528728636880022", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Transform_16536631540880170", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.713238Z','admin'),
