    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16545013509280026','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16545013509280026", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:41.880Z", "lastUser" : "v.kozlov", "Datamart.coll" : "Оборудование сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX rule: <http://ontology.adms.ru/UIP/rule/1#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n\nSELECT DISTINCT ?unique_key ?mRID ?IRIОборудования ?ИдентификаторСК11 ?НаименованиеЭлементаСтруктурыСети ?КодОбъектаЭлементаСтруктуры ?НаименованиеКлассаНапряжения \n?ПризнакПринадлежностиПотребителю ?ИдентификаторСУПА ?ДлинаПроводника ?ТипОборудования ?IRIКонтейнера ?ВведеноВЭксплуатацию\nWhere {\n ?IRIОборудования a astu:ACLineSegment .\n OPTIONAL {\n ?IRIОборудования astu:ConductingEquipment.BaseVoltage ?BaseVoltage .\n ?BaseVoltage astu:IdentifiedObject.name ?НаименованиеКлассаНапряжения .\n }\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети}\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.aliasName ?ИдентификаторСУПА}\n OPTIONAL {?IRIОборудования astu:Conductor.length ?ДлинаПроводника }\n OPTIONAL {?IRIОборудования astu:Equipment.EquipmentContainer ?IRIКонтейнера}\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.SKID ?ИдентификаторСК11}\n OPTIONAL {?IRIОборудования astu:Equipment.normallyInService ?ВведеноВЭксплуатацию}\n OPTIONAL {?IRIОборудования astu:astu:Equipment.isNotGridCompany ?ПризнакПринадлежностиПотребителю}\n OPTIONAL {\n ?EquipmentTechPlace astu:TechPlace.CodeTP ?КодОбъектаЭлементаСтруктуры ;\n astu:TechPlace.Type ?EquipmentTPType .\n }\n BIND(CONCAT(STR(?IRIОборудования),IF(BOUND(?BaseVoltage), STR(?BaseVoltage), \"\")) AS ?unique_key)\n BIND(\"Сегмент линии\" as ?ТипОборудования)\n BIND(replace(str(?IRIОборудования),str(astu:), \"\") as ?mRID)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16540723538890006", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16546980768950045", "label" : "Оборудование", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.719737Z','admin'),
