    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16631053685350032','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16631053685350032", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:43.178Z", "lastUser" : "r.azami", "Datamart.coll" : "Аннулирование ВТУ", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\n SELECT DISTINCT ?unique_key ?ДатаАннулированияВТУ ?НомерУведомленияВТУ \n ?ДатаУведомленияВТУ ?ТочкаПрисоединенияIRI ?ЗаявкаIRI \n WHERE {\n ?ЗаявкаIRI astu:TechConnectAct.TechConnectionSchemes ?ТочкаПрисоединенияIRI .\n ?ТочкаПрисоединенияIRI a astu:TechConnectionSheme . \n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.fulfillNoticeNumber ?НомерУведомленияВТУ . } \n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.fulfillNoticeDate ?ДатаУведомленияВТУ . } \n OPTIONAL { ?ТочкаПрисоединенияIRI astu:TechConnectionSheme.cancelFulfillNoticeDate ?ДатаАннулированияВТУ . } \n BIND(STR(?ТочкаПрисоединенияIRI) AS ?unique_key)\n }", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16593738616130045", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Transform_16593756044630048", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguil