    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16639371143300123','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16639371143300123", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:43.344Z", "lastUser" : "r.azami", "Datamart.coll" : "Оборудование сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nprefix owl: <http://www.w3.org/2002/07/owl#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\nSELECT DISTINCT ?unique_key ?mRID ?IRIОборудования ?ИдентификаторСК11 ?НаименованиеЭлементаСтруктурыСети ?КодОбъектаЭлементаСтруктуры ?НаименованиеКлассаНапряжения \n ?ПризнакПринадлежностиПотребителю ?НаименованиеФилиала ?НаименованиеВидаТехническогоМеста ?ИдентификаторСУПА ?ДлинаПроводника ?ТипСистемыШин ?ТипОборудования\n ?IRIКонтейнера ?НаименованиеНачальнойОпоры ?НаименованиеКонечнойОпоры ?ВведеноВЭксплуатацию\n WHERE { \n ?IRIОборудования astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети ;\n astu:IdentifiedObject.aliasName ?ИдентификаторСУПА ;\n a ?EquipmentClass .\n \n OPTIONAL {?IRIОборудования astu:astu:Equipment.isNotGridCompany ?ПризнакПринадлежностиПотребителю}\n OPTIONAL {?IRIОборудования astu:Equipment.EquipmentContainer ?IRIКонтейнера}\n OPTIONAL {?IRIОборудования astu:Equipment.normallyInService ?ВведеноВЭксплуатацию }\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.SKID ?ИдентификаторСК11}\n OPTIONAL {\n ?IRIОборудования astu:Equipment.PlaceEquipment ?EquipmentTechPlace .\n ?EquipmentTechPlace astu:TechPlace.CodeTP ?КодОбъектаЭлементаСтруктуры ;\n astu:TechPlace.Type ?EquipmentTPType .\n }\n OPTIONAL { ?IRIОборудования astu:ConductingEquipment.BaseVoltage ?EquipmentBaseVoltage .\n ?EquipmentBaseVoltage astu:IdentifiedObject.name ?EquipmentBaseVoltageName .\n }\n OPTIONAL {\n ?IRIОборудования astu:IdentifiedObject.OrganisationRoles ?OrganisationRole .\n OPTIONAL {?OrganisationRole rdfs:label ?НаименованиеФилиала .}\n }\n OPTIONAL {?EquipmentTPType rdfs:label ?НаименованиеВидаТехническогоМеста .}\n OPTIONAL {?IRIОборудования astu:Conductor.length ?ДлинаПроводника }\n OPTIONAL {?IRIОборудования astu:BusbarSection.busbarSystemKind ?ТипСистемыШин }\n OPTIONAL {\n ?IRIОборудования astu:PowerTransformer.PowerTransformerEnd ?PowerTransformerEnd .\n ?PowerTransformerEnd astu:TransformerEnd.BaseVoltage ?TEBaseVoltage .\n ?TEBaseVoltage astu:IdentifiedObject.name ?TEBaseVoltageName .\n }\n OPTIONAL {\n ?IRIОборудования astu:ACLineSegment.StartTower ?StartTower .\n ?StartTower astu:IdentifiedObject.name ?НаименованиеНачальнойОпоры .\n }\n OPTIONAL {\n ?IRIОборудования astu:ACLineSegment.EndTower ?EndTower .\n ?EndTower astu:IdentifiedObject.name ?НаименованиеКонечнойОпоры .\n }\n \n BIND(IF(BOUND(?EquipmentBaseVoltage),?EquipmentBaseVoltage,?TEBaseVoltage) AS ?BaseVoltage)\n BIND(IF(BOUND(?EquipmentBaseVoltage),?EquipmentBaseVoltageName,IF(BOUND(?TEBaseVoltage),?TEBaseVoltageName,\"\")) AS ?НаименованиеКлассаНапряжения)\n BIND(?IRIОборудования AS ?unique_key)\n BIND(replace(str(?EquipmentClass),str(astu:),\"\") as ?EquipmentType)\n BIND(IF(BOUND(?EquipmentType),IF(?EquipmentType = \"PowerTransformer\",\"Силовой трансформатор\",\n IF(?EquipmentType = \"ACLineSegment\",\"Сегмент линии\",\n IF(?EquipmentType = \"Fuse\",\"Предохранитель\",\n IF(?EquipmentType = \"Breaker\",\"Выключатель\",\n IF(?EquipmentType = \"Disconnector\",\"Разъединитель\",\n IF(?EquipmentType = \"Recloser\",\"Реклоузер\",\n IF(?EquipmentType = \"Bay\",\"Ячейка\",\n IF(?EquipmentType = \"BusbarSection\",\"Секция шин\",\"\")))))))),\"\") as ?ТипОборудования)\n BIND(replace(str(?IRIОборудования),str(astu:), \"\") as ?mRID)\n }", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16639358345860104", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Transform_16639374875100125", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.743970Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16642007005820136','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16642007005820136", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:43.501Z", "lastUser" : "r.azami", "Datamart.coll" : "Контейнеры оборудования сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\nprefix owl: <http://www.w3.org/2002/07/owl#> \n\nSELECT DISTINCT ?unique_key ?НаименованиеЭлементаСтруктурыСети ?КодОбъектаЭлементаСтруктуры ?НаименованиеКлассаНапряжения ?НаименованиеФилиала ?НаименованиеРЭС \n?НаименованиеУчастка ?mRID ?IRIКонтейнера ?ИдентификаторСК11 ?ПризнакПринадлежностиПотребителю ?НаименованиеВидаТехническогоМеста ?ИдентификаторСУПА ?ПризнакЦентраПитания \n?ТипКонтейнера ?IRIПодстанции ?ВведенВЭксплуатацию ?ВыведенИзЭксплуатации\nWHERE {\n VALUES ?EquipmentContainerClass { astu:Substation astu:VoltageLevel astu:Line }\n ?IRIКонтейнера a ?EquipmentContainerClass .\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.aliasName ?ИдентификаторСУПА}\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети}\n OPTIONAL {\n ?IRIКонтейнера astu:EquipmentContainer.PlaceEquipmentContainer ?TechPlace .\n ?TechPlace a astu:TechPlace ;\n astu:TechPlace.CodeTP ?КодОбъектаЭлементаСтруктуры ;\n astu:TechPlace.Type ?TPType .\n }\n OPTIONAL {?IRIКонтейнера astu:EquipmentContainer.isNotGridCompany ?ПризнакПринадлежностиПотребителю}\n filter (?EquipmentContainerClass != owl:NamedIndividual)\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.SKID ?ИдентификаторСК11}\n OPTIONAL {\n ?IRIКонтейнера astu:VoltageLevel.BaseVoltage ?BaseVoltage .\n ?BaseVoltage rdfs:label ?НаименованиеКлассаНапряжения .\n }\n OPTIONAL {?TPType rdfs:label ?НаименованиеВидаТехническогоМеста .}\n OPTIONAL {?IRIКонтейнера astu:Substation.isSupplyCenter ?ПризнакЦентраПитания}\n OPTIONAL {\n ?IRIКонтейнера astu:IdentifiedObject.OrganisationRoles ?OrganisationRole .\n OPTIONAL {?OrganisationRole rdfs:label ?НаименованиеФилиала .}\n }\n OPTIONAL {?IRIКонтейнера astu:VoltageLevel.Substation ?IRIПодстанции}\n OPTIONAL {\n ?IRIКонтейнера astu:Substation.Region ?SubstationSubRegion .\n ?SubstationSubRegion astu:IdentifiedObject.name ?SubstationSubRegionName ;\n astu:SubGeographicalRegion.Region ?SubstationRegion .\n ?SubstationRegion astu:IdentifiedObject.name ?SubstationRegionName . \n }\n OPTIONAL {\n ?IRIКонтейнера astu:Line.Region ?LineSubRegion .\n ?LineSubRegion astu:IdentifiedObject.name ?LineSubRegionName ;\n astu:SubGeographicalRegion.Region ?LineRegion .\n ?LineRegion astu:IdentifiedObject.name ?LineRegionName . \n }\n OPTIONAL {\n ?EquipmentContainer astu:PowerSystemResource.pSREvents ?PSREvent .\n ?PSREvent astu:PSREvent.kind astu:PSREventKindOutOfService .\n BIND(true AS ?PSREventKindOutOfService)\n }\n BIND(IF(BOUND(?PSREventKindOutOfService),?PSREventKindOutOfService,false) as ?ВыведенИзЭксплуатации)\n BIND(IF(BOUND(?SubstationSubRegionName),?SubstationSubRegionName,IF(BOUND(?LineSubRegionName),?LineSubRegionName,\"\")) as ?НаименованиеРЭС)\n BIND(IF(BOUND(?SubstationRegionName),?SubstationRegionName,IF(BOUND(?LineRegionName),?LineRegionName,\"\")) as ?НаименованиеУчастка)\n BIND(STR(?IRIКонтейнера) AS ?unique_key)\n BIND(replace(str(?EquipmentContainerClass),str(astu:),\"\") as ?EquipmentContainerType)\n BIND(replace(str(?IRIКонтейнера),str(astu:),\"\") as ?mRID)\n BIND(IF(BOUND(?EquipmentContainerType),IF(?EquipmentContainerType = \"Substation\",\"Подстанция\",\n IF(?EquipmentContainerType = \"Line\",\"Линия\",\n IF(?EquipmentContainerType = \"VoltageLevel\",\"РУ\",\"\"))),\"\") as ?ТипКонтейнера)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16639431956090127", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Transform_16642007413420137", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.747322Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16643197913340177','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16643197913340177", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:43.660Z", "lastUser" : "r.azami", "Datamart.coll" : "Оборудование сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX rule: <http://ontology.adms.ru/UIP/rule/1#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n\n SELECT DISTINCT ?unique_key ?IRIОборудования ?НаименованиеЭлементаСтруктурыСети ?НаименованиеКлассаНапряжения ?ДлинаПроводника \n ?ТипОборудования ?IRIКонтейнера\nWhere {\n ?IRIОборудования a astu:ACLineSegment .\n OPTIONAL {\n ?IRIОборудования astu:ConductingEquipment.BaseVoltage ?BaseVoltage .\n ?BaseVoltage astu:IdentifiedObject.name ?НаименованиеКлассаНапряжения .\n }\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети}\n OPTIONAL {?IRIОборудования astu:Conductor.length ?ДлинаПроводника }\nOPTIONAL {?IRIОборудования astu:Equipment.EquipmentContainer ?IRIКонтейнера}\n BIND(CONCAT(STR(?IRIОборудования),IF(BOUND(?BaseVoltage), STR(?BaseVoltage), \"\")) AS ?unique_key)\nBIND(\"Сегмент линии\" as ?ТипОборудования) \n }", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16540723538890006", "label" : "Оборудование 2", "@context" : { "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.750388Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16644052905730044','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16644052905730044", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:43.812Z", "lastUser" : "r.azami", "Datamart.coll" : "Оборудование сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nprefix owl: <http://www.w3.org/2002/07/owl#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\nSELECT DISTINCT ?unique_key ?mRID ?IRIОборудования ?ИдентификаторСК11 ?НаименованиеЭлементаСтруктурыСети ?КодОбъектаЭлементаСтруктуры ?НаименованиеКлассаНапряжения \n ?ПризнакПринадлежностиПотребителю ?НаименованиеФилиала ?НаименованиеВидаТехническогоМеста ?ИдентификаторСУПА ?ДлинаПроводника ?ТипСистемыШин ?ТипОборудования\n ?IRIКонтейнера ?НаименованиеНачальнойОпоры ?НаименованиеКонечнойОпоры ?ВведеноВЭксплуатацию\n WHERE { \n ?IRIОборудования astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети ;\n a ?EquipmentClass .\n \n OPTIONAL {?IRIОборудования astu:IdentifiedObject.aliasName ?ИдентификаторСУПА .}\n OPTIONAL {?IRIОборудования astu:Equipment.isNotGridCompany ?ПризнакПринадлежностиПотребителю .}\n OPTIONAL {?IRIОборудования astu:Equipment.EquipmentContainer ?IRIКонтейнера}\n OPTIONAL {?IRIОборудования astu:Equipment.normallyInService ?ВведеноВЭксплуатацию }\n OPTIONAL {?IRIОборудования astu:IdentifiedObject.SKID ?ИдентификаторСК11}\n OPTIONAL {\n ?IRIОборудования astu:Equipment.PlaceEquipment ?EquipmentTechPlace .\n ?EquipmentTechPlace astu:TechPlace.CodeTP ?КодОбъектаЭлементаСтруктуры ;\n astu:TechPlace.Type ?EquipmentTPType .\n }\n OPTIONAL { ?IRIОборудования astu:ConductingEquipment.BaseVoltage ?EquipmentBaseVoltage .\n ?EquipmentBaseVoltage astu:IdentifiedObject.name ?EquipmentBaseVoltageName .\n }\n OPTIONAL {\n ?IRIОборудования astu:IdentifiedObject.OrganisationRoles ?OrganisationRole .\n OPTIONAL {?OrganisationRole rdfs:label ?НаименованиеФилиала .}\n }\n OPTIONAL {?EquipmentTPType rdfs:label ?НаименованиеВидаТехническогоМеста .}\n OPTIONAL {?IRIОборудования astu:Conductor.length ?ДлинаПроводника }\n OPTIONAL {?IRIОборудования astu:BusbarSection.busbarSystemKind ?ТипСистемыШин }\n OPTIONAL {\n ?IRIОборудования astu:PowerTransformer.PowerTransformerEnd ?PowerTransformerEnd .\n ?PowerTransformerEnd astu:TransformerEnd.BaseVoltage ?TEBaseVoltage .\n ?TEBaseVoltage astu:IdentifiedObject.name ?TEBaseVoltageName .\n }\n OPTIONAL {\n ?IRIОборудования astu:ACLineSegment.StartTower ?StartTower .\n ?StartTower astu:IdentifiedObject.name ?НаименованиеНачальнойОпоры .\n }\n OPTIONAL {\n ?IRIОборудования astu:ACLineSegment.EndTower ?EndTower .\n ?EndTower astu:IdentifiedObject.name ?НаименованиеКонечнойОпоры .\n }\n \n BIND(IF(BOUND(?EquipmentBaseVoltage),?EquipmentBaseVoltage,?TEBaseVoltage) AS ?BaseVoltage)\n BIND(IF(BOUND(?EquipmentBaseVoltage),?EquipmentBaseVoltageName,IF(BOUND(?TEBaseVoltage),?TEBaseVoltageName,\"\")) AS ?НаименованиеКлассаНапряжения)\n BIND(?IRIОборудования AS ?unique_key)\n BIND(replace(str(?EquipmentClass),str(astu:),\"\") as ?EquipmentType)\n BIND(IF(BOUND(?EquipmentType),IF(?EquipmentType = \"PowerTransformer\",\"Силовой трансформатор\",\n IF(?EquipmentType = \"ACLineSegment\",\"Сегмент линии\",\n IF(?EquipmentType = \"Fuse\",\"Предохранитель\",\n IF(?EquipmentType = \"Breaker\",\"Выключатель\",\n IF(?EquipmentType = \"Disconnector\",\"Разъединитель\",\n IF(?EquipmentType = \"Recloser\",\"Реклоузер\",\n IF(?EquipmentType = \"Bay\",\"Ячейка\",\n IF(?EquipmentType = \"BusbarSection\",\"Секция шин\",\"\")))))))),\"\") as ?ТипОборудования)\n BIND(replace(str(?IRIОборудования),str(astu:), \"\") as ?mRID)\n }", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16644020166140001", "label" : "Запись в витрину", "@context" : { "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.752676Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16645184925200072','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16645184925200072", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:43.993Z", "lastUser" : "v.kozlov", "Datamart.coll" : "Контейнеры оборудования сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\nprefix owl: <http://www.w3.org/2002/07/owl#> \n\nSELECT DISTINCT ?unique_key ?НаименованиеЭлементаСтруктурыСети ?КодОбъектаЭлементаСтруктуры ?НаименованиеКлассаНапряжения ?НаименованиеРЭС \n?НаименованиеУчастка ?mRID ?IRIКонтейнера ?ИдентификаторСК11 ?ПризнакПринадлежностиПотребителю ?НаименованиеВидаТехническогоМеста ?ИдентификаторСУПА ?ПризнакЦентраПитания \n?ТипКонтейнера ?IRIПодстанции ?ВведенВЭксплуатацию ?ВыведенИзЭксплуатации\nWHERE {\n ?IRIКонтейнера a ?EquipmentContainerClass .\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.aliasName ?ИдентификаторСУПА}\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети}\n ?IRIКонтейнера astu:EquipmentContainer.PlaceEquipmentContainer ?TechPlace .\n OPTIONAL {\n ?TechPlace a astu:TechPlace ;\n astu:TechPlace.CodeTP ?КодОбъектаЭлементаСтруктуры ;\n astu:TechPlace.Type ?TPType .\n }\n OPTIONAL {?IRIКонтейнера astu:EquipmentContainer.isNotGridCompany ?ПризнакПринадлежностиПотребителю}\n filter (?EquipmentContainerClass != owl:NamedIndividual)\n filter (?EquipmentContainerClass != astu:editEquipmentContainer)\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.SKID ?ИдентификаторСК11}\n OPTIONAL {\n ?IRIКонтейнера astu:VoltageLevel.BaseVoltage ?BaseVoltage .\n ?BaseVoltage rdfs:label ?НаименованиеКлассаНапряжения .\n }\n OPTIONAL {?TPType rdfs:label ?НаименованиеВидаТехническогоМеста .}\n OPTIONAL {?IRIКонтейнера astu:Substation.isSupplyCenter ?ПризнакЦентраПитания}\n OPTIONAL {?IRIКонтейнера astu:VoltageLevel.Substation ?IRIПодстанции}\n OPTIONAL {\n ?IRIКонтейнера astu:Substation.Region ?SubstationSubRegion .\n ?SubstationSubRegion astu:IdentifiedObject.name ?SubstationSubRegionName ;\n astu:SubGeographicalRegion.Region ?SubstationRegion .\n ?SubstationRegion astu:IdentifiedObject.name ?SubstationRegionName . \n }\n OPTIONAL {\n ?IRIКонтейнера astu:Line.Region ?LineSubRegion .\n ?LineSubRegion astu:IdentifiedObject.name ?LineSubRegionName ;\n astu:SubGeographicalRegion.Region ?LineRegion .\n ?LineRegion astu:IdentifiedObject.name ?LineRegionName . \n }\n OPTIONAL {\n ?IRIПодстанции astu:Substation.Region ?VoltageLevelSubRegion .\n ?VoltageLevelSubRegion astu:IdentifiedObject.name ?VoltageLevelSubRegionName ;\n astu:SubGeographicalRegion.Region ?VoltageLevelRegion .\n ?VoltageLevelRegion astu:IdentifiedObject.name ?VoltageLevelRegionName . \n }\n OPTIONAL {\n ?IRIКонтейнера astu:Bay.VoltageLevel / astu:VoltageLevel.Substation ?Substation .\n ?Substation astu:Substation.Region ?BaySubRegion .\n ?BaySubRegion astu:IdentifiedObject.name ?BaySubRegionName ;\n astu:SubGeographicalRegion.Region ?BayRegion .\n ?BayRegion astu:IdentifiedObject.name ?BayRegionName . \n }\n OPTIONAL {\n ?EquipmentContainer astu:PowerSystemResource.pSREvents ?PSREvent .\n ?PSREvent astu:PSREvent.kind astu:PSREventKindInService .\n BIND(true AS ?PSREventKindInService)\n }\n BIND(IF(BOUND(?PSREventKindInService),?PSREventKindInService,false) as ?ВведенВЭксплуатацию)\n BIND(IF(BOUND(?SubstationSubRegionName),?SubstationSubRegionName,IF(BOUND(?LineSubRegionName),?LineSubRegionName,\"\")) as ?НаименованиеРЭС)\n BIND(IF(BOUND(?SubstationRegionName),?SubstationRegionName,IF(BOUND(?LineRegionName),?LineRegionName,\"\")) as ?НаименованиеУчастка)\n BIND(STR(?IRIКонтейнера) AS ?unique_key)\n BIND(false AS ?ВыведенИзЭксплуатации)\n BIND(replace(str(?EquipmentContainerClass),str(astu:),\"\") as ?EquipmentContainerType)\n BIND(replace(str(?IRIКонтейнера),str(astu:),\"\") as ?mRID)\n BIND(IF(BOUND(?EquipmentContainerType),IF(?EquipmentContainerType = \"Substation\",\"Подстанция\",\n IF(?EquipmentContainerType = \"Line\",\"Линия\",\n IF(?EquipmentContainerType = \"VoltageLevel\",\"РУ\",\"\"))),\"\") as ?ТипКонтейнера)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16644020677300002", "label" : "Запись в витрину", "@context" : { "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.755923Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16656981031950069','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16656981031950069", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:44.145Z", "lastUser" : "r.azami", "Datamart.coll" : "Передача заявки на ТП", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\n SELECT DISTINCT ?unique_key ?ЗаявкаТПНаименование ?ЗаявкаТПНомер ?ЗаявкаТПДата ?ХарактерПрисоединения ?КодЗаявкиТП ?УровеньНапряжения \n ?МаксимальнаяМощность ?КатегорияНадежности ?РЭСЗаявки ?УчастокЗаявки ?ХарактерНагрузки ?СтатусЗаявки ?ДатаНаправленияЗаявки ?НаименованиеЗаявителя \n ?НаименованиеЗаявителяПолное ?ТипЗаявителя ?ФамилияФЛ ?ИмяФЛ ?ИННЗаявителя ?КодЗаявителя ?КППЗаявителя ?ТелефонЗаявителя ?EMailЗаявителя ?ПочтовыйАдресЗаявителя \n ?ЮрАдресЗаявителя ?ОбъектЭС ?АдресОбъектаЭС ?КадастровыйНомерОбъектаЭС ?ЗаявкаТПIRI ?ЗаявительIRI\n WHERE {\n ?ЗаявкаТПIRI a astu:TechConnectAct .\n OPTIONAL { ?ЗаявкаТПIRI astu:IdentifiedObject.name ?ЗаявкаТПНаименование }\n OPTIONAL { \n ?ЗаявкаТПIRI astu:IdentifiedObject.Name ?КодЗаявкиТПIRI .\n ?КодЗаявкиТПIRI astu:Name.name ?КодЗаявкиТП .\n BIND(astu:TechConnectApplication_code as ?TechConnectActNameObjNameType)\n ?КодЗаявкиТПIRI astu:Name.NameType ?TechConnectActNameObjNameType .\n ?TechConnectActNameObjNameType astu:NameType.name ?ТипЗаявки .\n }\n OPTIONAL { ?ЗаявкаТПIRI astu:TechConnectAct.ApplicationNumber ?ЗаявкаТПНомер }\n OPTIONAL { ?ЗаявкаТПIRI astu:TechConnectAct.ApplicationDate ?ЗаявкаТПДата }\n OPTIONAL { ?ЗаявкаТПIRI astu:TechConnectAct.TechConnectActBaseVoltage ?УровеньНапряженияFloat }\n OPTIONAL { ?ЗаявкаТПIRI astu:TechConnectAct.PowerFull ?МаксимальнаяМощность }\n OPTIONAL { \n ?ЗаявкаТПIRI astu:TechConnectAct.CharacterConnect ?TechConnectActCharacterConnect .\n ?TechConnectActCharacterConnect a astu:CharacterConnect ;\n astu:CharacterConnect.name ?ХарактерПрисоединения .\n }\n OPTIONAL { ?ЗаявкаТПIRI astu:TechConnectAct.servicePriority ?КатегорияНадежности }\n OPTIONAL {\n ?ЗаявкаТПIRI astu:TechConnectAct.Applicant ?ЗаявительIRI .\n OPTIONAL { ?ЗаявительIRI astu:IdentifiedObject.name ?НаименованиеЗаявителя }\n OPTIONAL { ?ЗаявительIRI astu:Applicant.application ?Application }\n OPTIONAL { ?ЗаявительIRI astu:IdentifiedObject.aliasName ?НаименованиеЗаявителяПолное }\n OPTIONAL { ?ЗаявительIRI astu:Applicant.applicantType ?ТипЗаявителя }\n OPTIONAL { ?ЗаявительIRI astu:Applicant.surName ?ФамилияФЛ }\n OPTIONAL { ?ЗаявительIRI astu:Applicant.firstName ?ИмяФЛ }\n OPTIONAL { ?ЗаявительIRI astu:Applicant.individTaxNuber ?ИННЗаявителя }\n OPTIONAL { \n ?ЗаявительIRI astu:IdentifiedObject.Name ?ApplicantNameObj .\n ?ApplicantNameObj astu:Name.name ?КодЗаявителя .\n BIND(astu:Applicant_code as ?ApplicantNameObjNameType)\n ?ApplicantNameObj astu:Name.NameType ?ApplicantNameObjNameType .\n ?ApplicantNameObjNameType astu:NameType.name ?ApplicantNameObjNameTypeName .\n }\n OPTIONAL { ?ЗаявительIRI astu:Applicant.Kpp ?КППЗаявителя }\n OPTIONAL { ?ЗаявительIRI astu:Applicant.ContactNumber ?ТелефонЗаявителя }\n OPTIONAL { ?ЗаявительIRI astu:Applicant.EMail ?EMailЗаявителя }\n OPTIONAL { ?ЗаявительIRI astu:Applicant.PostalAddress ?ПочтовыйАдресЗаявителя }\n OPTIONAL { ?ЗаявительIRI astu:Applicant.LegalAddress ?ЮрАдресЗаявителя }\n }\n OPTIONAL {\n ?ЗаявкаТПIRI astu:TechConnectAct.SubGeographicalRegion ?SubGeographicalRegion .\n ?SubGeographicalRegion astu:IdentifiedObject.name ?УчастокЗаявки .\n OPTIONAL {\n ?SubGeographicalRegion astu:SubGeographicalRegion.Region ?Region .\n ?Region astu:IdentifiedObject.name ?РЭСЗаявки .\n }\n }\n OPTIONAL {?ЗаявкаТПIRI astu:TechConnectAct.LoadCharacter ?ХарактерНагрузки}\n OPTIONAL {?ЗаявкаТПIRI astu:TechConnectAct.State ?СтатусЗаявки}\n OPTIONAL {\n ?ЗаявкаТПIRI astu:TechConnectAct.ServiceLocation ?TechConnectActServiceLocation .\n ?TechConnectActServiceLocation astu:IdentifiedObject.name ?ОбъектЭС .\n OPTIONAL {\n ?TechConnectActServiceLocation astu:Location.mainAddress ?LocationMainAddress .\n ?LocationMainAddress astu:StreetAddress.streetDetail ?StreetDetail .\n ?StreetDetail astu:StreetDetail.AddressGeneral ?АдресОбъектаЭС .\n OPTIONAL {\n ?TechConnectActServiceLocation astu:Location.RealProperties ?RealProperty .\n ?RealProperty astu:RealProperty.ExternalRecordReference ?КадастровыйНомерОбъектаЭС .\n }\n }\n }\n OPTIONAL { ?ЗаявкаТПIRI astu:TechConnectAct.dateSendApplPrepContract ?ДатаНаправленияЗаявки }\n \n BIND(STR(?ЗаявкаТПIRI) AS ?unique_key)\n BIND(STR(?УровеньНапряженияFloat) AS ?УровеньНапряжения)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16585015413340042", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16603222036190060", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.758846Z','admin');
INSERT INTO "ServiceData" (iri, type, "profileVersion", configuration, content, "lastUpdated", "updatedBy") VALUES
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16685265888750103','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16685265888750103", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:44.294Z", "lastUser" : "r.azami", "Datamart.coll" : "Контейнеры оборудования сети", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\nprefix owl: <http://www.w3.org/2002/07/owl#> \n\nSELECT DISTINCT ?unique_key ?НаименованиеЭлементаСтруктурыСети ?КодОбъектаЭлементаСтруктуры ?НаименованиеКлассаНапряжения ?НаименованиеФилиала ?НаименованиеРЭС \n?НаименованиеУчастка ?mRID ?IRIКонтейнера ?ИдентификаторСК11 ?ПризнакПринадлежностиПотребителю ?НаименованиеВидаТехническогоМеста ?ИдентификаторСУПА ?ПризнакЦентраПитания \n?ТипКонтейнера ?IRIПодстанции ?ВведенВЭксплуатацию ?ВыведенИзЭксплуатации\nWHERE {\n VALUES ?EquipmentContainerClass { astu:Substation astu:VoltageLevel astu:Line astu:Bay }\n ?IRIКонтейнера a ?EquipmentContainerClass .\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.aliasName ?ИдентификаторСУПА}\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.name ?НаименованиеЭлементаСтруктурыСети}\n OPTIONAL {\n ?IRIКонтейнера astu:EquipmentContainer.PlaceEquipmentContainer ?TechPlace .\n ?TechPlace a astu:TechPlace ;\n astu:TechPlace.CodeTP ?КодОбъектаЭлементаСтруктуры ;\n astu:TechPlace.Type ?TPType .\n }\n OPTIONAL {?IRIКонтейнера astu:EquipmentContainer.isNotGridCompany ?ПризнакПринадлежностиПотребителю}\n filter (?EquipmentContainerClass != owl:NamedIndividual)\n OPTIONAL {?IRIКонтейнера astu:IdentifiedObject.SKID ?ИдентификаторСК11}\n OPTIONAL {\n ?IRIКонтейнера astu:VoltageLevel.BaseVoltage ?BaseVoltage .\n ?BaseVoltage rdfs:label ?НаименованиеКлассаНапряжения .\n }\n OPTIONAL {?TPType rdfs:label ?НаименованиеВидаТехническогоМеста .}\n OPTIONAL {?IRIКонтейнера astu:Substation.isSupplyCenter ?ПризнакЦентраПитания}\n OPTIONAL {\n ?IRIКонтейнера astu:IdentifiedObject.OrganisationRoles ?OrganisationRole .\n OPTIONAL {?OrganisationRole rdfs:label ?НаименованиеФилиала .}\n }\n OPTIONAL {?IRIКонтейнера astu:VoltageLevel.Substation ?IRIПодстанции}\n OPTIONAL {\n ?IRIКонтейнера astu:Substation.Region ?SubstationSubRegion .\n ?SubstationSubRegion astu:IdentifiedObject.name ?SubstationSubRegionName ;\n astu:SubGeographicalRegion.Region ?SubstationRegion .\n ?SubstationRegion astu:IdentifiedObject.name ?SubstationRegionName . \n }\n OPTIONAL {\n ?IRIКонтейнера astu:Line.Region ?LineSubRegion .\n ?LineSubRegion astu:IdentifiedObject.name ?LineSubRegionName ;\n astu:SubGeographicalRegion.Region ?LineRegion .\n ?LineRegion astu:IdentifiedObject.name ?LineRegionName . \n }\n OPTIONAL {\n ?EquipmentContainer astu:PowerSystemResource.pSREvents ?PSREvent .\n ?PSREvent astu:PSREvent.kind astu:PSREventKindOutOfService .\n BIND(true AS ?PSREventKindOutOfService)\n }\n BIND(IF(BOUND(?PSREventKindOutOfService),?PSREventKindOutOfService,false) as ?ВыведенИзЭксплуатации)\n BIND(IF(BOUND(?SubstationSubRegionName),?SubstationSubRegionName,IF(BOUND(?LineSubRegionName),?LineSubRegionName,\"\")) as ?НаименованиеРЭС)\n BIND(IF(BOUND(?SubstationRegionName),?SubstationRegionName,IF(BOUND(?LineRegionName),?LineRegionName,\"\")) as ?НаименованиеУчастка)\n BIND(STR(?IRIКонтейнера) AS ?unique_key)\n BIND(replace(str(?EquipmentContainerClass),str(astu:),\"\") as ?EquipmentContainerType)\n BIND(replace(str(?IRIКонтейнера),str(astu:),\"\") as ?mRID)\n BIND(IF(BOUND(?EquipmentContainerType),IF(?EquipmentContainerType = \"Substation\",\"Подстанция\",\n IF(?EquipmentContainerType = \"Line\",\"Линия\",\n IF(?EquipmentContainerType = \"VoltageLevel\",\"РУ\",\"\"))),\"\") as ?ТипКонтейнера)\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16639358345860104", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Transform_16685266170120104", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:13.762015Z','admin'),
    ('http://ontology.adms.ru/UIP/rule/1#Datamart_16717032981010006','http://ontology.adms.ru/UIP/rule/1#Datamart','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart_16717032981010006", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Datamart" ], "lastUpdate" : "2023-01-18T22:21:44.453Z", "lastUser" : "r.azami", "Datamart.coll" : "Создание сущности", "Datamart.query" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\nPREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>\nprefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>\nprefix owl: <http://www.w3.org/2002/07/owl#> \n\nSELECT DISTINCT ?GUIDОбъекта\n ?АтрибутОбъекта \n ?ЗначениеАтрибута\n\t\t\t\t?GUIDТехническогоМеста\n\t\t\t\t?КодТехническогоМеста \t\t\nWHERE {\n ?GUIDОбъекта a astu:Substation ;\n ?АтрибутОбъекта ?ЗначениеАтрибута .\n FILTER (isLiteral(?ЗначениеАтрибута))\n\t?GUIDТехническогоМеста a astu:TechPlace ;\n\t\tastu:TechPlace.CodeTP ?КодТехническогоМеста .\t\t\n}", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16717028100930002", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Message_16717033773900007", "label" : "Запись в витрину", "@context" : { "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "Datamart.query" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.query", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Datamart.coll" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Datamart.coll" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "htt