    ('http://ontology.adms.ru/UIP/rule/1#Transform_16601449657100021','http://ontology.adms.ru/UIP/rule/1#Transform','http://ontology.adms.ru/UIP/rule/1#','http://ontology.adms.ru/UIP/platform/cfg#PlatformConfiguration_00005328189858468609099','{ "@id" : "http://ontology.adms.ru/UIP/rule/1#Transform_16601449657100021", "@type" : [ "owl:NamedIndividual", "http://ontology.adms.ru/UIP/rule/1#Transform" ], "lastUpdate" : "2023-01-18T22:26:34.723Z", "lastUser" : "r.azami", "Rule.Pipeline" : "http://ontology.adms.ru/UIP/rule/1#Pipeline_16528728636880022", "Rule.next" : "http://ontology.adms.ru/UIP/rule/1#Message_16601453147560030", "Transform.insertDeleteQuery" : "PREFIX astu: <http://ontology.adms.ru/UIP/md/2021-1#>\n\nINSERT {\n GRAPH <urn:data:sk11> {\n ?Equipment a astu:ACLineSegment .\n ?Equipment astu:ConductingEquipment.Terminals ?Terminal .\n ?UsagePointSdpTrue astu:UsagePoint.Terminal ?Terminal .\n \n ?Terminal astu:Terminal.UsagePoints ?UsagePointSdpTrue .\n ?Terminal astu:Terminal.UsagePoints ?UsagePointSdpFalse .\n\n ?UsagePointSdpTrue a astu:UsagePoint . \n ?UsagePointSdpTrue astu:UsagePoint.isSdp ?isSdpTrue . \n ?UsagePointSdpTrue astu:UsagePoint.name ?UsagePointSdpTrueName . \n ?UsagePointSdpTrue astu:UsagePoint.mRID ?mrid . \n ?UsagePointSdpTrue astu:UsagePoint.Customer ?Customer . \n ?UsagePointSdpTrue astu:UsagePoint.ServiceLocation ?ServiceLocation . \n\n ?UsagePointSdpFalse a astu:UsagePoint . \n ?UsagePointSdpFalse astu:UsagePoint.isSdp ?isSdpFalse . \n ?UsagePointSdpFalse astu:UsagePoint.name ?UsagePointSdpFalseName . \n ?UsagePointSdpFalse astu:UsagePoint.mRID ?mrid . \n ?UsagePointSdpFalse astu:UsagePoint.Customer ?Customer . \n ?UsagePointSdpFalse astu:UsagePoint.ServiceLocation ?ServiceLocation . \n ?UsagePointSdpFalse astu:UsagePoint.EndDevices ?Meter . \n\n ?Meter astu:Meter.serialNumber ?SerialNumber . \n ?Meter astu:Meter.meteringPointCode ?type . \n ?Meter astu:Meter.mRID ?MeterMrid . \n ?Meter astu:Meter.isCommercial ?isCommercial .\n ?Meter astu:Meter.isVirtual ?MeterIsVirtual .\n ?Meter astu:Meter.isAMR ?MeterIsAMR .\n\n ?ServiceLocation astu:ServiceLocation.name ?ServiceLocationName . \n ?ServiceLocation astu:ServiceLocation.mRID ?ServiceLocationMrid . \n ?ServiceLocation astu:Location.mainAddress ?StreetDetail_AddressGeneral .\n ?ServiceLocation astu:ServiceLocation.supplyReliabilityRank ?servicePriority .\n ?ServiceLocation astu:ServiceLocation.serviceDispCategory ?ServiceLocation_serviceDispCategory .\n\n ?Customer astu:Customer.name ?CustomerName . \n ?Customer astu:Customer.mRID ?CustomerMrid .\n }\n}\nWhere {\n ?UsagePointSdpTrue a astu:UsagePoint . \n BIND(true as ?isSdpTrue)\n ?UsagePointSdpTrue astu:UsagePoint.isSdp ?isSdpTrue . \n OPTIONAL {\n ?UsagePointSdpTrue astu:IdentifiedObject.name ?UsagePointSdpTrueName . \n } \n OPTIONAL {\n ?UsagePointSdpTrue astu:UsagePoint.isCommercial ?isCommercial . \n } \n BIND(STRAFTER(str(?UsagePointSdpTrue), \"_\") as ?UsagePointSdpTrueMrid)\n\n OPTIONAL {\n ?AccountPointRole a astu:AccountPointRole .\n ?UsagePointSdpFalse a astu:UsagePoint .\n BIND(false as ?isSdpFalse)\n ?UsagePointSdpFalse astu:UsagePoint.isSdp ?isSdpFalse . \n OPTIONAL {\n ?AccountPointRole astu:AccountPointRole.name ?UsagePointSdpFalseName .\n }\n BIND(STRAFTER(str(?UsagePointSdpFalse), \"_\") as ?UsagePointSdpFalseMrid)\n }\n\n OPTIONAL {\n ?Meter a astu:Meter . \n OPTIONAL {\n ?Meter astu:Asset.SerialNumber ?SerialNumber . \n } \n OPTIONAL {\n ?Meter astu:Asset.type ?type . \n } \n OPTIONAL {\n ?Meter astu:EndDevice.IsVirtual ?MeterIsVirtual .\n }\n OPTIONAL {\n ?Meter astu:Meter.IsAMR ?MeterIsAMR .\n }\n BIND(STRAFTER(str(?Meter), \"_\") as ?MeterMrid)\n }\n\n OPTIONAL {\n ?ServiceLocation a astu:ServiceLocation .\n OPTIONAL {\n ?ServiceLocation astu:IdentifiedObject.name ?ServiceLocationName .\n }\n OPTIONAL {\n ?ServiceLocation astu:Location.mainAddress ?Location_mainAddress .\n ?Location_mainAddress astu:StreetAddress.streetDetail ?StreetAddress_streetDetail .\n ?StreetAddress_streetDetail astu:StreetDetail.AddressGeneral ?StreetDetail_AddressGeneral .\n }\n OPTIONAL {\n ?ServiceLocation astu:ServiceLocation.serviceDispCategory ?ServiceLocation_serviceDispCategory .\n }\n BIND(STRAFTER(str(?ServiceLocation), \"_\") as ?ServiceLocationMrid)\n }\n\n OPTIONAL {\n ?TechConnectAct a astu:TechConnectAct .\n OPTIONAL {\n ?TechConnectAct astu:TechConnectAct.servicePriority ?servicePriority .\n }\n }\n\n OPTIONAL {\n ?Customer a astu:Customer .\n OPTIONAL {\n ?Customer astu:IdentifiedObject.name ?CustomerName . \n }\n BIND(STRAFTER(str(?Customer), \"_\") as ?CustomerMrid)\n }\n\n\n OPTIONAL {\n ?Equipment a astu:ACLineSegment .\n OPTIONAL {\n ?Equipment astu:ConductingEquipment.Terminals ?TerminalInDb . \n }\n }\n\n BIND(IRI(CONCAT(str(astu:),\"Terminal_\",STRUUID())) AS ?TerminalCreated)\n BIND(IF(bound(?TerminalInDb), ?TerminalInDb, ?TerminalCreated) AS ?Terminal)\n}", "label" : "Create sk11 graph", "@context" : { "Transform.insertDeleteQuery" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Transform.insertDeleteQuery", "@type" : "http://infoguild.ru/ontologyModeler/ModelOntology#SPARQL" }, "Rule.next" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.next", "@type" : "@id" }, "Rule.Pipeline" : { "@id" : "http://ontology.adms.ru/UIP/rule/1#Rule.Pipeline", "@type" : "@id" }, "lastUser" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUser" }, "lastUpdate" : { "@id" : "http://infoguild.ru/ontologyModeler/ModelOntology#lastUpdate" }, "label" : { "@id" : "http://www.w3.org/2000/01/rdf-schema#label" }, "shacl" : "http://www.w3.org/ns/shacl#", "cims" : "http://iec.ch/TC57/1999/rdf-schema-extensions-19990926#", "mo" : "http://infoguild.ru/ontologyModeler/ModelOntology#", "owl" : "http://www.w3.org/2002/07/owl#", "rdf" : "http://www.w3.org/1999/02/22-rdf-syntax-ns#", "dcterm" : "http://purl.org/dc/terms/", "xsd" : "http://www.w3.org/2001/XMLSchema#", "rdfs" : "http://www.w3.org/2000/01/rdf-schema#" } }','2023-01-19T13:05:15.512941Z